import React from 'react';
import Plot from 'react-plotly.js'
import {get} from '../utils/Api'
import {Checkbox, List, ListItem, ListItemIcon, ListItemText} from '@material-ui/core'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      ticker_list: []
    };
  }
  componentDidMount = async () => {
    get('stocks/').then((resp) => {
      console.log(resp)
      this.setState({ticker_list: resp})
    })
    console.log(this.state)
  }

  render() {
    return (
      <List>
      {this.state.ticker_list.map((value) => {
        const labelId = `checkbox-list-label-${value.symbol}`;
        return (
          <ListItem key={value.symbol} role={undefined} dense button onClick={console.log('click')}>
            <ListItemIcon>
              <Checkbox
                edge="start"
                checked={1}
                tabIndex={-1}
                disableRipple
                inputProps={{ 'aria-labelledby': labelId }}
              />
            </ListItemIcon>
            <ListItemText id={labelId} primary={`Line item ${value + 1}`} />
          </ListItem>
        );
      })}
    </List>
    );
  }
}

export default App
